{"de": "Bei Bauvorhaben, die nach aussen in Erscheinung treten, ist ein Baugespann aufzustellen. 

Es ist in jedem Falle während der Dauer der öffentlichen Auflage stehen zu lassen (vgl. Art. 43 der kantonalen Raumplanungsverordnung [KRVO]).", "fr": null, "it": "Per progetti di costruzione visibili dall'esterno devono essere posate modine. 

In ogni caso esse devono essere lasciate sul posto per tutta la durata dell'esposizione pubblica (cfr. art. 43 dell'ordinanza cantonale sulla pianificazione territoriale [OPTC])."}

{"de": "Als Baute gelten im Allgemeinen ober- und unterirdische Gebäude oder gebäudeähnliche Objekte, welche in der Regel dreidimensional errichtet werden (z.B. Wohnhaus, Gewerbebaute, Holzschopf etc.). 

Als Anlage werden eher Einrichtungen bezeichnet, welche das Gelände oder den umliegenden Raum verändern. Meistens handelt es um dem Tiefbau zuzordnenden zweidimensionalen Eingriff (z.B. Terrainveränderungen, Strassen, Leitungen, Kiesabbau, Beschneinungsanlagen etc.).", "fr": null, "it": "In generale una «costruzione» è un edificio o un oggetto simile a un edificio fuori terra o sotterraneo di regola tridimensionale (ad es. abitazione, edificio artigianale, legnaia, ecc.). 

Per strutture che modificano il terreno o lo spazio circostante si usa piuttosto il concetto di «impianto». Si tratta perlopiù di interventi bidimensionali attribuibili al genio civile (ad es. modifiche del terreno, strade, condotte, estrazione di ghiaia, impianti di innevamento, ecc.)."}

{"de": "Alle gültigen Formulare, Gesetze und Protokolle sind unter [energienachweis.gr.ch](http://www.energienachweis.gr.ch/) zu finden.

Im Rahmen der «Privaten Kontrolle» prüfen akkreditierte Fachleute für die Fachbereiche Wärmedämmung, Heizungsanlagen sowie Klima- und Belüftungsanlagen, ob ein Bauvorhaben den gesetzlichen Bestimmungen entspricht und nach den bewilligten Plänen ausgeführt wurde. Die Formulare «Energienachweise» und «Ausführungskontrolle» müssen beim Bauamt eingereicht werden.", "fr": null, "it": "Moduli, leggi e protocolli validi si possono trovare all'indirizzo [energienachweis.gr.ch](http://www.energienachweis.gr.ch/).

Nel quadro del «Controllo privato» specialiste e specialisti accreditati dei settori isolamento termico, impianti di riscaldamento nonché impianti di climatizzazione e di ventilazione verificano se un progetto edilizio è conforme alle disposizioni di legge ed è stato realizzato secondo i piani autorizzati. I moduli «Certificati energetici» e «Controllo dell'esecuzione» devono essere trasmessi all'ufficio edile."}

