{"de": "**BITTE BEACHTEN** Die Voraussetzungen für die Befreiung von der Baubewilligungspflicht sind voraussichtlich nicht erfüllt. Es ist Ihnen freigestellt die geplante Solaranlage trotzdem vorerst der Gemeinde mit dem Formular "Solaranlage" zu melden. Wir möchten Sie darauf hinweisen, dass ein allfälliger Verfahrenswechsel mit einem zusätzlichen Zeitverlust verbunden ist.

Um einen unnötigen Zeitverlust zu vermeiden, empfehlen wir Ihnen, das Formular "Baugesuch" zu verwenden und ein Baugesuch einzureichen.", "fr": "", "it": "**ATTENZIONE** Con ogni probabilità i presupposti per l'esenzione dall'obbligo della licenza edilizia non sono soddisfatti. Ciononostante può notificare il previsto impianto solare dapprima al Comune usando il modulo «Impianto solare». Rendiamo attenti al fatto che un eventuale cambiamento di procedura richiederà maggiore tempo per l'elaborazione.

Per evitare di perdere inutilmente tempo raccomandiamo di usare il modulo «Domanda di costruzione» e di presentare una relativa domanda."}

{"de": "Bitte beachten Sie, dass gemäss kantonalen Brandschutzgesetzes Art. 7 Abs. 1 folgende Vorhaben bewilligungspflichtig sind:

1. Neu-, An-, Um- und Ausbauten sowie die Umnutzung von Gebäuden oder Gebäudeteilen;
1. Neu-, Aus- und Umbauten von haustechnischen Anlagen und technischen Brandschutzeinrichtungen;
1. Betriebe, Anlagen und Einrichtungen, die der Herstellung, Verarbeitung oder Lagerung feuer- oder explosionsgefährlicher Stoffe und Waren dienen;
1. Veranstaltungen mit besonderer Gefährdung von Personen, Tieren oder Sachen;
1. das Abbrennen von pyrotechnischen Gegenständen zu Vergnügungszwecken (Feuerwerkskörper) und zu gewerblichen Zwecken.", "fr": "", "it": ""}

