{"de": "Das eidg. Zweitwohnungsgesetz (ZWG) gelangt in verschiedenen Gemeinden zur Anwendung (vgl. [Karte](https://map.geo.admin.ch/?topic=ech&lang=de&bgLayer=ch.swisstopo.pixelkarte-farbe&layers=ch.swisstopo.zeitreihen,ch.bfs.gebaeude_wohnungs_register,ch.bav.haltestellen-oev,ch.swisstopo.swisstlm3d-wanderwege,ch.are.wohnungsinventar-zweitwohnungsanteil&layers_visibility=false,false,false,false,true&layers_timestamp=18641231,,,,&layers_opacity=1,1,1,1,0.75&E=2785394.25&N=1180381.63&zoom=2)). In diesen Gemeinden ist der Neubau von Zweitwohnungen nicht zulässig. Bauwillige haben daher mit dem Baugesuch bekannt zu geben, ob bzw. welche Wohnungen touristisch bewirtschaftet werden und welche Wohnungen als Erstwohnung oder als einer Erstwohnung gleichgestellten Wohnung genutzt werden sollen. 

Diese Angaben sind in einem Plan zu verorten oder in einem Wohnungsspiegel zu bezeichnen.", "fr": null, "it": "La legge sulle abitazioni secondarie (LASec) viene applicata in diversi comuni (cfr. [cartina](https://map.geo.admin.ch/?topic=ech&lang=it&bgLayer=ch.swisstopo.pixelkarte-farbe&layers=ch.swisstopo.zeitreihen,ch.bfs.gebaeude_wohnungs_register,ch.bav.haltestellen-oev,ch.swisstopo.swisstlm3d-wanderwege,ch.are.wohnungsinventar-zweitwohnungsanteil&layers_visibility=false,false,false,false,true&layers_timestamp=18641231,,,,&layers_opacity=1,1,1,1,0.75&E=2785394.25&N=1180381.63&zoom=2). In questi comuni non è ammessa la nuova costruzione di abitazioni secondarie. Con la domanda di costruzione chi intende costruire deve dunque comunicare se e quali abitazioni vengono gestite a scopi turistici e quali abitazioni vengono invece utilizzate come abitazioni primarie oppure come abitazioni equiparate alle abitazioni primarie. 

Queste indicazioni devono essere inserite in un piano o in una tabella delle abitazioni."}

{"de": "####INFO

In den Gemeinden, in denen der Anteil von Zweitwohnungen gemäss ZWG mehr als 20% beträgt, müssen die Wohnungen entsprechend der Nutzung anhand dieser Auswahl mit oder ohne im Grundbuch eingetragene Nutzungsbeschränkung gemäss ZWG, klassiert werden.", "fr": null, "it": "####INFO

Nei comuni in cui la quota di abitazioni secondarie conformemente alla LASec supera il 20%, le abitazioni devono essere classificate in base al loro utilizzo secondo la presente selezione con o senza limitazione d'uso iscritta a registro fondiario conformemente alla LASec."}
